import React from 'react';
import styles from './cajaTable.module.css';

export default function CajaTable({ items = [], onView = () => {} }) {
  return (
    <div className={styles.container}>
      <div className={styles.tableWrapper}>
        <table className={styles.table}>
          <thead className={styles.theadRow}>
            <tr>
              {['ID', 'Empleado', 'Apertura', 'Cierre', 'Estado', 'Monto apertura', 'Monto cierre', 'Acciones']
                .map((h, i) => (
                  <th key={i} className={styles.th} style={{ textAlign: i === 7 ? 'center' : 'left' }}>{h}</th>
                ))}
            </tr>
          </thead>
          <tbody>
            {items.length ? items.map((c, i) => (
              <tr
                key={c.id_caja || i}
                className={styles.tr}
                style={{ background: i % 2 === 0 ? '#f9f9f9' : '#fff' }}
                onMouseEnter={e => e.currentTarget.style.background = '#e3f2fd'}
                onMouseLeave={e => e.currentTarget.style.background = i % 2 === 0 ? '#f9f9f9' : '#fff'}
              >
                <td className={styles.td}>{c.id_caja}</td>
                <td className={styles.td}>{c.empleado || '—'}</td>
                <td className={styles.td}>{c.fecha_hora_apertura || '—'}</td>
                <td className={styles.td}>{c.fecha_hora_cierre || '—'}</td>
                <td className={`${styles.td} ${c.estado_caja === 1 ? styles.estadoAbierta : styles.estadoCerrada}`}>
                  {c.estado_caja === 1 ? 'Abierta' : 'Cerrada'}
                </td>
                <td className={styles.td}>${c.monto_apertura || '0'}</td>
                <td className={styles.td}>${c.monto_cierre || '0'}</td>
                <td className={styles.td} style={{ textAlign: 'center' }}>
                  <button className={styles.btnVer} onClick={() => onView(c.id_caja)}>Ver</button>
                </td>
              </tr>
            )) : (
              <tr>
                <td colSpan="8" className={styles.emptyMessage}>No hay registros de caja.</td>
              </tr>
            )}
          </tbody>
        </table>
      </div>

      <div className={styles.responsiveCards}>
        {items.length ? items.map((c, i) => (
          <div key={c.id_caja || i} className={styles.card}>
            <p><strong>ID:</strong> {c.id_caja}</p>
            <p><strong>Empleado:</strong> {c.empleado || '—'}</p>
            <p><strong>Apertura:</strong> {c.fecha_hora_apertura || '—'}</p>
            <p><strong>Cierre:</strong> {c.fecha_hora_cierre || '—'}</p>
            <p><strong>Estado:</strong> <span className={c.estado_caja === 1 ? styles.estadoAbierta : styles.estadoCerrada}>{c.estado_caja === 1 ? 'Abierta' : 'Cerrada'}</span></p>
            <p><strong>Monto apertura:</strong> ${c.monto_apertura || '0'}</p>
            <p><strong>Monto cierre:</strong> ${c.monto_cierre || '0'}</p>
            <button className={styles.btnVer} onClick={() => onView(c.id_caja)}>Ver</button>
          </div>
        )) : (
          <p className={styles.emptyMessage}>No hay registros de caja.</p>
        )}
      </div>
    </div>
  );
}
